"use strict";(self.webpackChunkkershner_recipes=self.webpackChunkkershner_recipes||[]).push([[970],{4203:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"/greek-wraps","metadata":{"permalink":"/recipes/greek-wraps","editUrl":"https://github.com/dkershner6/recipes/recipes/greek-wraps.md","source":"@site/recipes/greek-wraps.md","title":"Keto Greek Wraps","description":"A Greek Salad with dressing swapped for tzatziki, wrapped in a tortilla. What\'s not to love?","date":"2024-05-20T00:00:00.000Z","formattedDate":"May 20, 2024","tags":[{"label":"greek","permalink":"/recipes/tags/greek"},{"label":"keto","permalink":"/recipes/tags/keto"},{"label":"bright","permalink":"/recipes/tags/bright"},{"label":"fresh","permalink":"/recipes/tags/fresh"},{"label":"tried-and-true","permalink":"/recipes/tags/tried-and-true"}],"readingTime":1.52,"hasTruncateMarker":false,"authors":[{"name":"Derek Kershner","title":"Sous Chef","url":"https://github.com/dkershner6","imageURL":"https://avatars.githubusercontent.com/u/25798427?s=400&u=a64040907ad0c23d4beb5bc08d8f99374e19ee00&v=4","key":"dkershner"}],"frontMatter":{"title":"Keto Greek Wraps","description":"A Greek Salad with dressing swapped for tzatziki, wrapped in a tortilla. What\'s not to love?","authors":"dkershner","date":"2024-05-20T00:00:00.000Z","tags":["greek","keto","bright","fresh","tried-and-true"]},"nextItem":{"title":"Keto \\"Mac\\" Salad","permalink":"/recipes/mac-salad"}},"content":"## Ingredients\\n\\n### Chicken + Marinade\\n\\n-   3 lbs Chicken Tenderloins, whole or roughly chopped\\n-   1/2 cup Olive Oil\\n-   1 Tbsp Lemon Juice\\n-   2 Jalepenos\\n-   1/2 cup Fresh Parsely Stems (or dried if you don\'t have fresh)\\n-   5 cloves Garlic, minced\\n-   1 Tbsp Thyme\\n-   2 Tbsp Rosemary\\n-   1 Tbsp Red Pepper Flakes (Optional, if not a spicy fan)\\n\\n### Tzatziki\\n\\n-   1 cup Greek Yogurt (Try to find lower sugar varieties for Keto, typically higher fat helps some)\\n-   1/2 English Cucumber, grated, salted, and thoroughly pressed and drained\\n-   1 Tbsp Lemon Juice\\n-   1 Tbsp Dill\\n-   2 cloves Garlic, minced\\n-   Salt (to taste)\\n\\n### Toppings\\n\\n-   1/2 medium red onion, minced\\n-   2 Roma Tomatoes, diced\\n-   1 cup Pitted Kalamata Olives, sliced\\n-   1/2 cup Sheep Feta Cheese, crumbled (or normal feta if you can\'t find sheep)\\n-   1 cup Pepperoncini, sliced\\n-   Lots of greens (Baby Spinach, Arugula, Kale, Chard, etc)\\n-   Tabasco (optional)\\n\\n### Also\\n\\n-   10-12 Tortillas (I prefer Mission Carb Balance Whole Wheat)\\n\\n## Instructions\\n\\n### Chicken + Marinade\\n\\n1. Put stemmed jalepenos, parsely, olive oil, lemon juice into a blender, blend until smooth.\\n2. Add garlic, thyme, rosemary, red pepper flakes.\\n3. Pour marinade over chicken, mix well, and let sit for at least 2 hours, ideally overnight.\\n\\n### Tzatziki\\n\\n1. Mix all ingredients together well, and let sit for at least 2 hours, ideally overnight.\\n\\n### Meal Time\\n\\n1.  Grill or pan fry chicken on very high heat, until cooked through and slightly charred. Salt and pepper to taste, be bold. Liquid should be completely gone.\\n2.  Place line of chicken on tortilla, then red onion, tomato, olives, feta.\\n3.  Add tabasco at this time if desired.\\n4.  Add pepperoncinis, some tzatziki, then copious greens."},{"id":"/mac-salad","metadata":{"permalink":"/recipes/mac-salad","editUrl":"https://github.com/dkershner6/recipes/recipes/mac-salad.md","source":"@site/recipes/mac-salad.md","title":"Keto \\"Mac\\" Salad","description":"Keto Mac Salad recipe, using exactly zero Mac.","date":"2024-02-12T00:00:00.000Z","formattedDate":"February 12, 2024","tags":[{"label":"hawaiian","permalink":"/recipes/tags/hawaiian"},{"label":"keto","permalink":"/recipes/tags/keto"},{"label":"bright","permalink":"/recipes/tags/bright"},{"label":"fresh","permalink":"/recipes/tags/fresh"},{"label":"tried-and-true","permalink":"/recipes/tags/tried-and-true"}],"readingTime":0.775,"hasTruncateMarker":false,"authors":[{"name":"Derek Kershner","title":"Sous Chef","url":"https://github.com/dkershner6","imageURL":"https://avatars.githubusercontent.com/u/25798427?s=400&u=a64040907ad0c23d4beb5bc08d8f99374e19ee00&v=4","key":"dkershner"}],"frontMatter":{"title":"Keto \\"Mac\\" Salad","description":"Keto Mac Salad recipe, using exactly zero Mac.","authors":"dkershner","date":"2024-02-12T00:00:00.000Z","tags":["hawaiian","keto","bright","fresh","tried-and-true"]},"prevItem":{"title":"Keto Greek Wraps","permalink":"/recipes/greek-wraps"},"nextItem":{"title":"Keto Lasagna","permalink":"/recipes/lasagna"}},"content":"## Ingredients\\n\\n-   2 lbs of Cauliflower, in 1/2inch x 1/2inch chunks\\n-   1 medium red onion, minced\\n-   2 Fresno Peppers, minced\\n-   2 cups Castelvetrano Olives, pitted and sliced\\n-   3 cloves garlic, minced (or more, to taste)\\n-   1/2 cup Apple Cider Vinegar\\n-   1/4 cup Dijon Mustard with whole seeds\\n-   1/2 cup Mayonaise\\n-   Salt (to taste)\\n-   Pepper (to taste, but use a lot)\\n\\n## Instructions\\n\\n1. Steam Cauliflower until tender, but still has bite. This is by far the hardest part of the recipe, and when in doubt, pull it out EARLY. Too crunchy is better than too mushy.\\n2. In large colander, drain cauliflower, then rinse with copious cold water. This will help it cool down faster.\\n3. In large mixing bowl, mix all ingredients together well, starting with the more sauce-like ingredients.\\n4. Refreigerate for at least 2 hours, ideally overnight.\\n\\nServe at fridge temps, Enjoy!"},{"id":"/lasagna","metadata":{"permalink":"/recipes/lasagna","editUrl":"https://github.com/dkershner6/recipes/recipes/lasagna.md","source":"@site/recipes/lasagna.md","title":"Keto Lasagna","description":"Keto Lasagna recipe, both nutritious and delicious.","date":"2024-02-10T00:00:00.000Z","formattedDate":"February 10, 2024","tags":[{"label":"comfort","permalink":"/recipes/tags/comfort"},{"label":"italian","permalink":"/recipes/tags/italian"},{"label":"keto","permalink":"/recipes/tags/keto"},{"label":"savory","permalink":"/recipes/tags/savory"},{"label":"tried-and-true","permalink":"/recipes/tags/tried-and-true"}],"readingTime":1.15,"hasTruncateMarker":false,"authors":[{"name":"Derek Kershner","title":"Sous Chef","url":"https://github.com/dkershner6","imageURL":"https://avatars.githubusercontent.com/u/25798427?s=400&u=a64040907ad0c23d4beb5bc08d8f99374e19ee00&v=4","key":"dkershner"}],"frontMatter":{"title":"Keto Lasagna","description":"Keto Lasagna recipe, both nutritious and delicious.","authors":"dkershner","date":"2024-02-10T00:00:00.000Z","tags":["comfort","italian","keto","savory","tried-and-true"]},"prevItem":{"title":"Keto \\"Mac\\" Salad","permalink":"/recipes/mac-salad"}},"content":"## Ingredients\\n\\n### Sauce\\n\\n-   1/4 cup extra virgin olive oil\\n-   1-1.5 lb ground turkey\\n-   1 stalk Celery\\n-   1 medium yellow onion\\n-   6 cloves garlic (or more, to taste)\\n-   2 Pints Chicken Stock\\n-   1/2 cup red wine (any)\\n-   2 pinches Italian Seasoning\\n-   2 bay leaf\\n-   2 Roma tomatoes\\n-   1 bunch collard greens (about 6-7 leaves)\\n-   1 cup almond flour\\n-   Calabrian Chili Flakes (to taste)\\n-   Salt (to taste)\\n-   Pepper (to taste)\\n\\n### Lasagna\\n\\n-   2 cans heart of palm lasagna noodles\\n-   14 oz queso fresco\\n-   Bit of grated parmesan\\n\\n## Instructions\\n\\n### Sauce\\n\\n1. In dutch oven or pot, olive oil and diced onion and celery until translucent.\\n2. Brown ground turkey, minced garlic, then add chicken stock. Bring back to light boil / simmer.\\n3. Add Italian seasoning, bay leaf, calabrian chili flakes, and red wine.\\n4. Remove ribs from collards, roughly chop, add.\\n5. Simmer for hours, at least 1-2.\\n6. Chop and add tomatoes.\\n7. Add almond flour.\\n8. Simmer for half hour.\\n9. Add salt, pepper.\\n\\n### Lasagna\\n\\n1. Preheat oven to 375F.\\n2. In Pyrex or similar baking dish, layer noodles, then sauce, then queso fresco, then parmesan 3 times each.\\n3. Top with pepper.\\n4. Bake for an hour until cheese is browned.\\n\\nWait a bit, then eat. Enjoy!"}]}')}}]);